import React from "react";

function InformationTable({ infoText1, infoText2, informationTable }) {
  let Table = [];

  for (var i in informationTable) {
    Table.push([i, informationTable[i]]);
  }

  return (
    <div className="container d-flex justify-content-center mt-5">
      {/* <div className="row"> */}
      <div className="col-sm">{infoText1}</div>
      <div className="col-sm">
        <div className="table">
          <thead>
            <tr>
              <th className="">Key</th>
              <th>Info</th>
            </tr>
          </thead>
          {informationTable.map(() => {
            return (
              <tr>
                <td>s</td>
                <td>s</td>
              </tr>
            );
          })}
          <tr>
            <td>Pa</td>
            <td>2x2x2</td>
          </tr>
          <tr>
            <td>Item Weight</td>
            <td>2kg</td>
          </tr>
          <tr>
            <td>Manufacturer</td>
            <td>Snpur Tech</td>
          </tr>
          <tr>
            <td>ASIN</td>
            <td>B0291238ds</td>
          </tr>
          <tr>
            <td>Customer Review</td>
            <td>5</td>
          </tr>
        </div>
      </div>
      <div className="col-sm">{infoText2}</div>
      {/* </div> */}
    </div>
  );
}

export default InformationTable;
